import React, { useState, useEffect } from "react";
import axios from "axios";

export default function CrudDb() {
  const [posts, setPosts] = useState([]);
  const [name, setName] = useState("");
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState("");
  const [balance, setBalance] = useState("");
  const [editingPost, setEditingPost] = useState(null);

  useEffect(() => {
    axios
      .get("http://localhost:8888/bank/read")
      .then((response) => {
        setPosts(response.data);
      })
      .catch((error) => {
        console.error("There was an error fetching the posts!", error);
      });
  }, []);

  // Create a new post
  const createPost = () => {
    axios
      .post("http://localhost:8888/bank/add", {
        name,
        username,
        email,
        phone,
        balance
      })
      .then((response) => {
        setPosts([...posts, response.data]);
        setName("");
        setUsername("");
        setEmail("");
        setPhone("");
        setBalance("");
      })
      .catch((error) => {
        console.error("There was an error creating the post!", error);
      });
  };

  // Update a post
  const updatePost = (post) => {
    axios
      .put(`http://localhost:8888/bank/read/${post.id}`, post)
      .then((response) => {
        setPosts(posts.map((p) => (p.id === post.id ? response.data : p)));
        setEditingPost(null);
        setName("");
        setUsername("");
        setEmail("");
        setPhone("");
        setBalance("");
      })
      .catch((error) => {
        console.error("There was an error updating the post!", error);
      });
  };

  // Delete a post
  const deletePost = (id) => {
    axios
      .delete(`http://localhost:8888/bank/delete/${id}`)
      .then(() => {
        setPosts(posts.filter((post) => post.id !== id));
      })
      .catch((error) => {
        console.error("There was an error deleting the post!", error);
      });
  };

  const handleEditClick = (post) => {
    setEditingPost(post);
    setName(post.name);
    setUsername(post.username);
    setEmail(post.email);
    setPhone(post.phone);
    setBalance(post.balance);
  };

  const handleSaveClick = () => {
    if (editingPost) {
      updatePost({ ...editingPost, name, username, email, phone, balance });
    } else {
      createPost();
    }
  };

  return (
    <div className="App">
      <h1>React Axios CRUD Example</h1>
      <div>
        <input
          type="text"
          placeholder="Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
        <input
          type="text"
          placeholder="Username"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
        />

        <input
          type="text"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />
        <input
          type="text"
          placeholder="Phone"
          value={phone}
          onChange={(e) => setPhone(e.target.value)}
        />
        <input
          type="text"
          placeholder="Balance"
          value={balance}
          onChange={(e) => setBalance(e.target.value)}
        />
        <button onClick={handleSaveClick}>
          {editingPost ? "Update Post" : "Add Post"}
        </button>
      </div>
      <ul>
        {posts.map((post) => (
          <li key={post.id}>
            <p>{post.name}</p>
            <p>{post.username}</p>
            <p>{post.email}</p>
            <p>{post.phone}</p>
            <p>{post.balance}</p>
            <button onClick={() => handleEditClick(post)}>Edit</button>
            <button onClick={() => deletePost(post.id)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
}
